create schema dwh;


create table dwh.ta_stg_artikel (artikel_nr varchar(100) primary key,
    artikelbeschreibung varchar(100) not null,
    artikelpreis decimal (9,2) not null);

create table dwh.ta_stg_land (id integer primary key,
    name_land varchar(100) not null);

create table dwh.ta_stg_kunde (kundennummer integer primary key,
    id_land integer not null references dwh.ta_stg_land);

create table dwh.ta_stg_rechnung (rechnung_nr integer primary key,
    rechnungsdatum date not null,
    kundennummer integer references dwh.ta_stg_kunde);

create table dwh.ta_stg_rechnung_position(rechnung_nr integer references dwh.ta_stg_rechnung,
    rechnung_position integer not null,
    artikel_nr varchar(100) references dwh.ta_stg_artikel,
    menge integer not null);

alter table dwh.ta_stg_rechnung_position add primary key (rechnung_nr, rechnung_position);

create or replace
function dwh.set_dwh_erstellt_am() returns trigger as $BODY$ begin
new.dwh_erstellt_am = now();
return new;
end;

$BODY$ language plpgsql volatile;

create table dwh.ta_cor_artikel (dwh_core_id integer not null generated always as identity primary key,
    dwh_erstellt_am timestamp NOT NULL,
	artikel_nr varchar(100) not null,
    artikelbeschreibung varchar(100) not null,
    artikelpreis decimal (9,2) not null);

create trigger ta_cor_artikel_dwh_erstellt_am_trigger before insert or update on dwh.ta_cor_artikel for each row execute procedure dwh.set_dwh_erstellt_am();

create table dwh.ta_cor_land (dwh_core_id integer not null generated always as identity primary key,
    dwh_erstellt_am timestamp NOT NULL,
    id integer not null,
    name_land varchar(100) not null);

create trigger ta_cor_land_dwh_erstellt_am_trigger before insert or update on dwh.ta_cor_land for each row execute procedure dwh.set_dwh_erstellt_am();

create table dwh.ta_cor_kunde (dwh_core_id integer not null generated always as identity primary key,
    dwh_erstellt_am timestamp NOT NULL,
    kundennummer integer not null,
    id_land integer not null);

create trigger ta_cor_kunde_dwh_erstellt_am_trigger before insert or update on dwh.ta_cor_kunde for each row execute procedure dwh.set_dwh_erstellt_am();

create table dwh.ta_cor_rechnung (dwh_core_id integer not null generated always as identity primary key,
    dwh_erstellt_am timestamp NOT NULL,
    rechnung_nr integer not null,
    rechnungsdatum date not null,
    kundennummer integer not null);

create trigger ta_cor_rechnung_dwh_erstellt_am_trigger before insert or update on dwh.ta_cor_rechnung for each row execute procedure dwh.set_dwh_erstellt_am();

create table dwh.ta_cor_rechnung_position(dwh_core_id integer not null generated always as identity primary key,
    dwh_erstellt_am timestamp NOT NULL,
    rechnung_nr integer not null,
    rechnung_position integer not null,
    artikel_nr varchar(100) not null,
    menge integer not null);

create trigger ta_cor_rechnung_position_dwh_erstellt_am_trigger before insert or update on dwh.ta_cor_rechnung_position for each row execute procedure dwh.set_dwh_erstellt_am();





